module CHIP (
	clk, 
	rst, 
	i_m_P_valid,
       i_nP_valid,
       i_mode,
       i_a,
       i_prime,
       i_m,
       i_nPx,
       i_nPy,
       i_Px,
       i_Py,
       o_mP_valid,
       o_mnP_valid,
       o_mPx,
       o_mPy,
       o_mnPx,
       o_mnPy
       );

   input clk;
   input rst;
   input i_m_P_valid;
   input i_nP_valid;
   input i_mode;
   input i_a;
   input i_prime;
   input i_m;
   input i_nPx;
   input i_nPy;
   input i_Px;
   input i_Py;
   output o_mP_valid;
   output o_mnP_valid;
   output o_mPx;
   output o_mPy;
   output o_mnPx;
   output o_mnPy;


   // Internal wires
   wire i_clk_p_i;
   wire i_reset_n_i;
   wire n_logic0;
   wire n_logic1;
   wire i_m_P_valid_i;
   wire i_nP_valid_i;
   wire i_mode_i;
   wire i_a_i;
   wire i_prime_i;
   wire i_m_i;
   wire i_nPx_i;
   wire i_nPy_i;
   wire i_Px_i;
   wire i_Py_i;
   wire o_mP_valid_o;
   wire o_mnP_valid_o;
   wire o_mPx_o;
   wire o_mPy_o;
   wire o_mnPx_o;
   wire o_mnPy_o;

   Wrapper wrapper_in( 
       .clk(i_clk_p_i),
       .rst(i_reset_n_i),
       .i_m_P_valid(i_m_P_valid_i), 
       .i_nP_valid(i_nP_valid_i), 
       .i_mode(i_mode_i), 
       .i_a(i_a_i), 
       .i_prime(i_prime_i),  
       .i_m(i_m_i), 
       .i_nPx(i_nPx_i), 
       .i_nPy(i_nPy_i), 
       .i_Px(i_Px_i), 
       .i_Py(i_Py_i),
       .o_mP_valid(o_mP_valid_o), 
       .o_mnP_valid(o_mnP_valid_o), 
       .o_mPx(o_mPx_o), 
       .o_mPy(o_mPy_o), 
       .o_mnPx(o_mnPx_o), 
       .o_mnPy(o_mnPy_o) );

  TIE0 ipad_n_logic0(.O(n_logic0));
  TIE1 ipad_n_logic1(.O(n_logic1));
  XMD ipad_clk_p_i (.O(i_clk_p_i), .I(clk), .PU(n_logic0), .PD(n_logic0), .SMT(n_logic0));
  XMD ipad_reset_n_i (.O(i_reset_n_i), .I(rst), .PU(n_logic0), .PD(n_logic0), .SMT(n_logic0));
  XMD ipad_i_m_P_valid (.O(i_m_P_valid_i), .I(i_m_P_valid), .PU(n_logic0), .PD(n_logic0), .SMT(n_logic0));
  XMD ipad_i_nP_valid (.O(i_nP_valid_i), .I(i_nP_valid), .PU(n_logic0), .PD(n_logic0), .SMT(n_logic0));
  XMD ipad_i_mode (.O(i_mode_i), .I(i_mode), .PU(n_logic0), .PD(n_logic0), .SMT(n_logic0));
  XMD ipad_i_a (.O(i_a_i), .I(i_a), .PU(n_logic0), .PD(n_logic0), .SMT(n_logic0));
  XMD ipad_i_prime (.O(i_prime_i), .I(i_prime), .PU(n_logic0), .PD(n_logic0), .SMT(n_logic0));
  XMD ipad_i_m (.O(i_m_i), .I(i_m), .PU(n_logic0), .PD(n_logic0), .SMT(n_logic0));
