  XMD ipad_i_Py (.O(i_Py_i), .I(i_Py), .PU(n_logic0), .PD(n_logic0), .SMT(n_logic0));
  
  YA2GSD ipad_o_mP_valid (.O(o_mP_valid), .I(o_mP_valid_o), .E(n_logic1), .E2(n_logic0), .E4(n_logic0), .E8(n_logic0), .SR(n_logic0));
