  YA2GSD ipad_o_mPy (.O(o_mPy), .I(o_mPy_o), .E(n_logic1), .E2(n_logic0), .E4(n_logic0), .E8(n_logic0), .SR(n_logic0));
  YA2GSD ipad_o_mnPx (.O(o_mnPx), .I(o_mnPx_o), .E(n_logic1), .E2(n_logic0), .E4(n_logic0), .E8(n_logic0), .SR(n_logic0));
